The graph of $y=f(x)$ is shown below.  The graph of $y=ax+2a$ is a line with slope $a$ and $y$-intercept $2a$.  The graph of $y=ax^2$ is a parabola with vertex at $(0,0)$ and axis of symmetry $x=0$.

[asy]
Label f;

f.p=fontsize(6);

xaxis(-4,4,Ticks(f, 1.0));

yaxis(-4,10,Ticks(f, 1.0));

real f(real x)

{

return (x>2)?(x^2):((x+4)/2);

}

draw(graph(f,-3.9,2), linewidth(1));
draw((-3.9,4)--(4,4), dashed);
draw((-3.9,-4)--(4,-4), dashed);
draw((-3.9,1.5)--(4,1.5), dashed);
draw((-3.9,-1.5)--(4,-1.5), dashed);
draw((-3.9,0)--(4,0), dashed);
label("$y=ax+2a$", (4,10), E);
label("$y=ax^2$", (4,4), E);
[/asy]

The graph of $y=ax+2a$ is a line with slope $a$ and $y$-intercept $2a$.  The graph of $y=ax^2$ is a parabola with vertex at $(0,0)$ and axis of symmetry $x=0$.  The line $y=ax+2a$ will intersect the parabola $y=ax^2$ at two points if and only if the line is tangent to the parabola.  The line $y=ax+2a$ is tangent to the parabola $y=ax^2$ if and only if the equation $ax+2a=ax^2$ has exactly one solution.  This equation is equivalent to $ax^2-ax-2a=0$, which has exactly one solution if and only if its discriminant is 0.  The discriminant of $ax^2-ax-2a$ is $a^2+8a$.  Therefore, the line $y=ax+2a$ is tangent to the parabola $y=ax^2$ if and only if $a^2+8a=0$.  This equation has solutions $a=0$ and $a=-8$.  The graph of $y=ax+2a$ is shown below for $a=-8$.

