draw((-3.9,4)--(4,4), dashed);
draw((-3.9,-4)--(4,-4), dashed);
draw((-3.9,1.5)--(4,1.5), dashed);
draw((-3.9,-1.5)--(4,-1.5), dashed);
draw((-3.9,0)--(4,0), dashed);
label("$y=ax+2a$", (4,10), E);
label("$y=ax^2$", (4,4), E);
[/asy]

The line $y=ax+2a$ intersects the $x$-axis at $x=-2$.  Therefore, the line $y=ax+2a$ intersects the $y$-axis at $y=2a$.  The line $y=ax+2a$ intersects the $y$-axis at $y=2a$ if and only if $2a\geq 0$, or $a\geq 0$.  Therefore, the largest possible value of $a$ is $\boxed{0}$.

